import React from 'react';
import SignIn from './components/signIn';
import SignUp from './components/signUp';

function App() {
  state = {
    buttonClick: 0
  };
  return (
        <div>
          <SignUp />
          <SignIn />
        </div>
  );
}
increment = () => {
  this.state.buttonClick++;
  const counter = this.state.buttonClick;
  this.setState({counter});
  // return counter;
}
extandNavBar = () => {
  let col;
  col = (this.state.buttonClick % 2 == 0) ? "col-lg-2 col-md-2 d-none d-sm-none  d-md-block listLength" : "col-12 col-md-2 col-lg-2 listLength";
  return col;
}

export default App;
